import "./watch.css";

const Watch = () => {
    return (
        <div className="watch">
            <div className="watch__wrapper">
                <video width="100%" height="100%" controls>
                    <source
                        src="https://youtu.be/G63xSsl2DDk"
                        type="video/mp4"
                    />
                </video>
            </div>
        </div>
    );
};

export default Watch;
